import React, { useEffect, useState } from 'react';
import axios, { AxiosResponse } from 'axios';

const Users = () => {
    const [data, setData] = useState({} as AxiosResponse<any>);

    useEffect(() => {
        axios.get("http://127.0.0.1:5000/data").then((data) => {
            setData(data);
        });
    }, []);

    const renderData = () => {
        return (<ul>
            {(data && data.data ? data.data.map((each: any) =>
                (
                    <li>{each.name} {each.age} {each.id}</li>
                )
            ) : '')}
        </ul>)
    }
    return (
        <div>
            {renderData()}
        </div>
    );
}

export default Users;
